CREATE DEFINER=`root`@`localhost` FUNCTION `fn_fecha_ultima_tx_cliente`(p_id_cliente INT, p_id_linea INT, p_id_tipo_transaccion SMALLINT) RETURNS datetime
    READS SQL DATA
BEGIN
	DECLARE v_fecha_ultima_tx DATETIME;
	
	SELECT fecha INTO v_fecha_ultima_tx
	FROM transacciones AS t
	INNER JOIN servicios AS s
		ON t.id_servicio = s.id_servicio
	WHERE s.id_cliente = p_id_cliente
